export default function App() {
  return (
    <div className="tips">
      <BillInput />
      <SelectPercentage />
      <Reset />
    </div>
  );
}

function TipCalculator() {}

function BillInput() {
  return (
    <div>
      How much was the bill?
      <input type="text" />
    </div>
  );
}

function SelectPercentage() {
  return (
    <div>
      <div>
        How did you like the service?
        <select>
          <option>It was ok (5%)</option>
          <option>It was good (10%)</option>
          <option>It was amazing (20%)</option>
        </select>
      </div>

      <div>
        How did you friend like the service?
        <select>
          <option>It was ok (5%)</option>
          <option>It was good (10%)</option>
          <option>It was amazing (20%)</option>
        </select>
      </div>

      <h1>You pay $92 ($80 + $12 tip)</h1>
    </div>
  );
}

function Output() {}

function Reset() {
  return <button>Reset</button>;
}
